  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon Department of Geology & Mineral
  Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
  topographic LiDAR data for multiple areas within the State of Oregon. The areas
  for LiDAR collection have been designed as part of a collaborative effort of state,
  federal, and local agencies in order to meet a wide range of project goals. This
  LiDAR data set was collected between May 3, 2008 and April 25, 2009 and encompasses
  portions of the following counties in southwest Oregon- Coos, Curry, Lane, and Douglas.
  This data set consists of bare earth and unclassified points. There are approximately
  8 points per square meter over terrestrial surfaces. In some areas of heavy vegetation
  or forest cover, there may be relatively few ground points in the LiDAR data. Elevation
  values for open water surfaces are not valid elevation values because few LiDAR
  points are returned from water surfaces. LiDAR intensity values were also collected.\",\n\t\"owner_org\":
